body.text:
{
    "name": "Phylolib",
    "description": "A library of efficient algorithms for phylogenetic analysis",
    "library": {
				"machineAddress": "localhost:5555",
				"image": "luanab/phylolib",				
        "name": "phylolib",
			  "commandGroups": [
					{
						"groupName": "Arguments",
						"order": 0,
						"allowedCommandRepetition": false,
						"commands": [
							{ 
                "name": "help",
								"invocation": [
											"help"
								]
							},
							{
									"name": "distance",									
									"invocation": [
											"distance"
									],
									"allowedValues": [
											"hamming",
											"grapetree",
											"kimura"
									],
									"allowedCommandSets": [
											"Options"
									]
							},
							{
									"name": "correction",									
									"invocation": [
											"correction"
									],
									"allowedValues": [
											"jukescantor"											
									],
									"allowedCommandSets": [
											"Options"
									]
							},
							{
									"name": "algorithm",									
									"invocation": [
											"algorithm"
									],
									"allowedValues": [
											"goeburst",
											"edmonds",
											"sl",
											"cl",
											"upgma",
											"upgmc",
											"wpgma",
											"wpgmc",
											"saitounei",
											"studierkepler",
											"unj"
									],
									"allowedCommandSets": [
											"Options"
									]
							},
							{
									"name": "optimization",									
									"invocation": [
											"optimization"
									],
									"allowedValues": [
											"lbr"
									],
									"allowedCommandSets": [
											"Options"
									]
							}
						]
					},
					{
						"groupName": "Options",
						"order": 1,
						"allowedCommandRepetition": true,
						"commands": [
								{
										"name": "File Output",
										"description": "Output file as <format>:<location> with format being (asymmetric|symmetric|newick|nexus)",
										"invocation": [
												"-o",
												"--out"
										],
										"allowedValues": [
												"file"												
										]
								},
								{
										"name": "Dataset Input",
										"description": "Input dataset file as <format>:<location> with format being (fasta|ml|snp)",
										"invocation": [
												"-d",
												"--dataset"
										],
										"allowedValues": [
												"file"									
										]
								},
								{
										"name": "Distance Matrix Input",
										"description": "IInput distance matrix file as <format>:<location> with format being (asymmetric|symmetric)",
										"invocation": [
												"-m",
												"--matrix"
										],
										"allowedValues": [
												"file"									
										]
								},
								{
										"name": "Phylogenetic Tree Input",
										"description": "Input phylogenetic tree file as <format>:<location> with format being (newick|nexus)",
										"invocation": [
												"-m",
												"--matrix"
										],
										"allowedValues": [
												"file"									
										]
								},
								{
										"name": "Limit of focus variants",
										"description": "Limit of locus variants to consider using goeBURST algorithm [default: 3]",
										"invocation": [
												"-l",
												"--lvs"
										],
										"allowedValues": [
												"file"									
										]
								}
						]	
					}

				]        
    }
}
